import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import HomePage from 'pages/home';

function RootRouter() {
	return (
		<BrowserRouter>
			<Routes>
				<Route path="/" element={<HomePage />} />
			</Routes>
		</BrowserRouter>
	);
}

export default RootRouter;
